import React from 'react';
import './App.css';

function App() {
  return (
  <html>
    <head>
      <title>"My first Website</title>
    </head>
    <body>
      <div className="App">
      <header className="App-header">
        <p>
          My first Website
        </p>
      </header>
    </div>
    </body>
  </html>
  );
}

export default App;
